to puzzle this out completely, i looked for wifieventcb, wifieventfunccb, and wifieventsyscb and found them in the same header file above of class wifigenericclass:
typedef void (*wifieventcb)(system_event_id_t event);
typedef std::function<void(system_event_id_t event, system_event_info_t info)> wifieventfunccb;
typedef void (*wifieventsyscb)(system_event_t *event);

this is what the three typedefs mean:

wifieventcb ... a function pointer to a (free) function which returns void and has one parameter of type system_event_id_t
wifieventfunccb ... a std::function object for anything returning void and having two parameters of types system_event_id_t and system_event_info_t
wifieventsyscb ... a function pointer to a (free) function which returns void and has one parameter of type system_event_id_t*.

